import login from "./login.png";
import trasync from "./trasync.png";
function Login() {
  return (
    <>
      <div className="flex">
        <img className="w-" src={login} alt="login"></img>
        <div>
          <img className="h-min" src={trasync} alt="trasync"></img>
          <h>Login</h>
        </div>
      </div>
    </>
  );
}

export default Login;
